<script>
 document.addEventListener('DOMContentLoaded', () => {
  const settings = {
   intensity: 35,
   duration: 0.3,
   easing: 'power2.out'
  };

  const imageRevealHoverElements = document.querySelectorAll('.gt3-image-reveal-hover');

  imageRevealHoverElements.forEach(element => {
   const widgetImage = element.querySelector('.elementor-widget-image img');

   if (!widgetImage) return;

   const handleMouseMove = event => {
    const rect = element.getBoundingClientRect();
    const offsetX = ((event.clientX - rect.left) / rect.width) * (settings.intensity * 2) - settings.intensity;
    const offsetY = ((event.clientY - rect.top) / rect.height) * (settings.intensity * 2) - settings.intensity;

    gsap.to(widgetImage, {
     x: offsetX,
     y: offsetY,
     duration: settings.duration,
     ease: settings.easing
    });
   };

   const handleMouseLeave = () => {
    gsap.to(widgetImage, {
     x: 0,
     y: 0,
     duration: settings.duration,
     ease: settings.easing
    });
   };

   element.addEventListener('mousemove', handleMouseMove);
   element.addEventListener('mouseleave', handleMouseLeave);
  });
 });
